code = """
print("填写你要混淆的代码，可以整活玩玩，但还是要秉持开源精神哦，方法见源码")
print()
print("≧ ﹏≦")
abcd = 1234
del abcd
dsafasfd = 114514
"""
awa = "sadfherghjcbxhjber7y3fhcdsjgfiurehdfkj今vhy114天514你19198100721asdww了吗" # 故意加的，随便改

def a(x:int) -> str:
    res = []
    def b(num):
        nonlocal res
        if num <= 2:
            if num != 0:
                res.append(num//2)
            return
        c = num
        d = 0
        while c > 1:
            c = c >> 1
            d += 1
        res.append(d)
        return b(num-2**d)
    b(x)
    return res

def pack(x:int):
    return f"((-~0_0 |- ~0_0){' << (-~0_0 |- ~0_0)'*x})"

res = []
for i in code:
    tmp = ""
    for j in a(ord(i)):
        tmp += pack(j)
        tmp += " + "
    res.append(tmp[:-3])

# 运行标识
res.append("")

